import React from "react";
import Container from "react-bootstrap/Container";
import CarouselBrands from "../sub-components/CarouselBrands";
import Button from "react-bootstrap/Button";


const Home = (props) => {
    return (
        <section id="home">

            <div className="banner-hotline">
                <img className="banner-image" src="/images/desktop.aadf6093.jpg" alt="" />
            </div>

            <Container>
                <div className="carousel-brands">

                        <h1>As Seen On</h1>
                        <CarouselBrands />

                </div>

                <div className="features">

                        <h1>Full of Flavour, not sugar</h1>
                        <h3>Full-fat cream is the foundation of our Old-World recipe and why we have the lowest possible sugar.</h3>

                        <Button variant="primary" href="/story">
                            Let's Compare Sugar
                        </Button>

                        <img className="stock-image" src="images/BW-2001-Betterwith-Website-WeStock-Banner_SS2.c62a639c.png" alt="Betterwith Stock" />

                        <h1>Uncompromising</h1>
                        <h3>Only simple ingredients. No gums. No preservatives. And no fillers.</h3>

                        <Button variant="primary" href="/store">
                            Where to Buy
                        </Button>

                </div>

            </Container>
        </section>
    );
};


export default Home;
